const AuthorItem = ({author}) => {
	return(
			<tr>
			{author.username}
			</tr>
	)
}

const AuthorsList = ({authors}) => {
	return(
		<table> 
			{authors.map((author) => <AuthorItem author= {author} />)}
		</table>
	)
}

export default AuthorsList;
